// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "./loteria.sol";
import "./gestorGanadores.sol";

contract factory {
    address public loteriaAddress;
    address public gestorGanadoresAddress;

    constructor() {
        
        gestorGanadores contratoGanadores = new gestorGanadores(msg.sender);
        gestorGanadoresAddress = address(contratoGanadores);

        loteria contratoLoteria = new loteria(msg.sender, gestorGanadoresAddress);
        loteriaAddress = address(contratoLoteria);

        contratoGanadores.setLoteriaAddress(loteriaAddress);
    }
}
